    /**
     * Gets the attribute value for TOTAL_AMOUNT using the alias name TotalAmount.
     * @return the TOTAL_AMOUNT
     */
    public BigDecimal getTotalAmount() {
        String chargeName = this.getChargeName();
        BigDecimal chargeAmt = new BigDecimal(0);
        BigDecimal vatAmt = new BigDecimal(0);
        BigDecimal totalAmt = new BigDecimal(0);
        
        if(
        "RENT_INCOME_DAY_CONSUM".equals(chargeName) || 
        "TWO_MONTH_PENALTY".equals(chargeName) || 
        "CHEQUE_WITHDRA_FEE".equals(chargeName)||
        "ACCESS_CARD".equals(chargeName)
        ){
            chargeAmt = this.getAmount()!=null?this.getAmount():new BigDecimal(0);
            vatAmt = this.getVatAmount()!=null?this.getVatAmount():new BigDecimal(0);
            totalAmt = chargeAmt.add(vatAmt);
            this.setTotalAmount(totalAmt);
            return totalAmt;
            
        } 
        if("TOTAL".equals(chargeName)){
            XxplCancellationCharge_VOImpl impl = (XxplCancellationCharge_VOImpl)getViewObject();
            totalAmt = impl.getTotalSumAmt();
            this.setTotalAmount(totalAmt);
            return totalAmt;
        } 
        if("DUE_TAB1".equals(chargeName)){
            XxplCancellationCharge_VOImpl impl = (XxplCancellationCharge_VOImpl)getViewObject();
            totalAmt = impl.getTotalDueAmt();
            this.setTotalAmount(totalAmt);
            return totalAmt;
        }
        if("NET DUE".equals(chargeName)){
            XxplCancellationCharge_VOImpl impl = (XxplCancellationCharge_VOImpl)getViewObject();
            totalAmt = impl.getTotalNetDueAmt();
            this.setTotalAmount(totalAmt);
            return totalAmt;
        }
        return (BigDecimal) getAttributeInternal(TOTALAMOUNT);   
        
    }

