    /**
     * Gets the attribute value for VAT_AMOUNT using the alias name VatAmount.
     * @return the VAT_AMOUNT
     */
    public BigDecimal getVatAmount() {
        String chargeName = this.getChargeName();
        BigDecimal chargeAmt = new BigDecimal(0);
        BigDecimal taxRate = new BigDecimal(0);
        BigDecimal vatAmt = new BigDecimal(0);
        if("RENT_INCOME_DAY_CONSUM".equals(chargeName) ||
           "TWO_MONTH_PENALTY".equals(chargeName) || 
           "CHEQUE_WITHDRA_FEE".equals(chargeName)||
            "ACCESS_CARD".equals(chargeName))  
        {
            chargeAmt = this.getAmount()!=null?this.getAmount():new BigDecimal(0);
            taxRate = this.getTaxRate()!=null?this.getTaxRate():new BigDecimal(0);
            vatAmt = (taxRate.multiply(chargeAmt).divide(new BigDecimal(100)));
            return vatAmt;
        }
        if("TOTAL".equals(chargeName)){
            XxplCancellationCharge_VOImpl impl = (XxplCancellationCharge_VOImpl)getViewObject();
            vatAmt = impl.getTaxSumAmt();
            return vatAmt;
        }
           return (BigDecimal) getAttributeInternal(VATAMOUNT);   
    }

